import React from 'react';

function EnderecoClinica() {
  return (
    <div>
      <h4>Endereço da Clínica:</h4>
      <p>Rua das Flores, 123 - Centro - São Paulo/SP</p>
    </div>
  );
}

export default EnderecoClinica;
